import {
  // styled,
  
  // InputBase,
 
 
  Box, Divider, FormControl,

  
 
} from "@mui/material";






const Searchbar = () => {
  return (
    <>
       <Box sx={{display: "flex" , backgroundColor:'#fff' ,borderRadius:'100px'}} >
        <Box sx={{flexGrow:1}}>
             <FormControl>
              <select>

              </select>
             </FormControl>
        </Box>
        <Divider orientation="vertical" flexItem />
        <Box sx={{flexGrow:2}}>
          Searchbar
        </Box>

       </Box>

     
      
    </>
  )
}

export default Searchbar
